import React from 'react';
import './App.css';
import {Switch, Route} from 'react-router-dom'
import HomePage from './pages/homepage/homepage';

function App() {
  return (
       <Switch>
           <Route path = '/' render = {() => <HomePage></HomePage>}></Route>
       </Switch>
   );
}

export default App;
